import Typewriter from 'typewriter-effect';


export const Type = () => {

  return (
    <Typewriter 
        options={{
            string: ['Strive to blend creativity with functionality, crafting visually appealing and user-friendly websites.', 
                    'passionate about translating ideas into interactive digital experiences that engage and inspire.' ],
            autoStart: true,
            loop: true,
            delay: 50
        }}
    />
  )
}
